,"papermill":{"duration":4.936678,"end_time":"2022-06-26T01:10:24.216852","exception":false,"start_time":"2022-06-26T01:10:19.280174","status":"completed"},"tags":[]},"outputs":[],"source":["# Create a csv file output in Kaggle\n","counts <- aggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual + all_trips_v2$day_of_week, FUN = mean)\n","write.csv(counts, file = '/kaggle/working/counts.csv')"]},{"cell_type":"markdown","id":"84c8526e","metadata":{"papermill":{"duration":0.019846,"end_time":"2022-06-26T01:10:24.256545","exception":false,"start_time":"2022-06-26T01:10:24.236699","status":"completed"},"tags":[]},"source":["## Key Takeaways and Recommendations\n","\n","1. Casual riders use our bikes more often on weekends than annual riders. We can capitalize on this by offering membership perks for recreational, cultural, and entertainment activities. This will incentivize casual riders who primarily use our product on weekends to become annual members. It also provides a nice reason for annual riders to renew their memberships and show up to social events on our bikes, boosting our exposure.\n","2. The average ride duration is much longer for casual riders than annual members. We could run an ad campaign notifying casual riders that it is cheaper to become members after a certain number of rides. We could cite the recent surge in gas prices as another reason to ditch their cars and use our product to get to and from work. This combination of economic and environmental incentizes makes our product the most ethical choice on the market."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":107.050167,"end_time":"2022-06-26T01:10:24.598242","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","p